import { Col, Container, Row } from "react-bootstrap";
import routes from "../routers/routes";
import { Link } from "react-router-dom";

export default function HomePage() {
    return (
        <Container>
            <Row className="mt-5"> 
                <Col className='text-center'>
                    <h2>Bienvenid@ al Gestor de Tareas</h2>
                    <p>Aqui podras gestionar tus proyectos!</p>
                    <p>
                        Marca tus tareas como terminadas, agregar,
                        eliminar o actualizar.
                    </p>
                    <div>
                        <Link to={routes.login}>Ingrese</Link> o <button as={Link} to={routes.register}>Crea una cuenta </button>
                    </div>
                </Col>
            </Row>
        </Container>
    )
}
